  false,\n\t\"url\": null,\n\t\"notes\": \"The object of this study is to attempt
  to extend the breeding range of the Atlantic Loggerhead Turtle northward to some
  of its reported previous range along the Atlantic coast. This exchange will happen
  from Romain National Wildlife Refuge in South Carolina to Chincoteague National
  Wildlife Refuge in Virginia where there is 20 miles of protected beach. This report
  details the results of the 1971 season and presents recommendations for future work.\",\n\t\"owner_org\":
